import React from 'react';
import styled from 'styled-components';

export default (props) => {
  return (
    <Styles className="card CalendarMain promoCalendarDiv1 mt-3">
      <h6>{props.description}</h6>
    </Styles>
  );
};

const Styles = styled.div`
  text-align: center;
  height: 350px;
  h6 {
    line-height: 15rem;
  }
`;
